import Header from './Components/header';
import Hero from './Components/hero';
import Intro from './Components/intro';
import { ParallaxProvider } from 'react-scroll-parallax';

function App() {
  return (
    <div className="scroller">
      <ParallaxProvider>
      <section>
        <Header />
        </section>
        <section>
        <Hero />
        </section>
        <section>
        <Intro />
        </section>
      </ParallaxProvider>
    </div>
  );
}

export default App;
